uint32_t min_Hand_Color = ST7735_RED;
uint32_t hour_Hand_Color = ST7735_BLUE;

void startClock(void){
	//Setup Screen
	ST7735_FillScreen(ST7735_BLACK);
	ST7735_SetTextColor(ST7735_CYAN);
	ST7735_SetCursor(0, 0);
	ST7735_OutString("Juliana&Enrique");
	ST7735_SetCursor(0, 1);
	ST7735_OutString("Lab3");
	ST7735_SetCursor(0, 2);

	paintClockFace();
	runClockFace();
	//paintDigitalClock(0,0);
	//setDigitalClock(0,0);
}


void paintClockFace(void){
	
	ST7735_FillRect(0, 20, 127, 159, ST7735_BLACK);
	//To Draw image of clock with no arms
	ST7735_DrawBitmap(10, 140, clockFace, 112, 112);
	
}

//need to write function so that it draws over previous hand
// and then creates new hand to help with screen flickering 
//issue
//center of clock is (64,77)
void drawClockHand(uint32_t hour, uint32_t min){
	min = min % 60;
	hour = hour % 12;
	
	switch(min){
		case 0:
			//0 min
			ST7735_Line(64, 86, 64, 55, min_Hand_Color);
			//5 min
			ST7735_Line(64, 86, 78, 62, min_Hand_Color);
			//10 min
			ST7735_Line(64, 86, 86, 81, min_Hand_Color);
			//15
			ST7735_Line(64, 86, 86, 86, min_Hand_Color);
			break;
		
		case 15:
			ST7735_Line(64, 77, 86, 77, min_Hand_Color);
			break;
		
		case 30:
			ST7735_Line(64, 77, 64, 99, min_Hand_Color);
			break;
		
		case 45:
			ST7735_Line(64, 77, 42, 77, min_Hand_Color);
			break;
		
	}
	
	
	switch(hour){
		case 0:
			//0 min
			ST7735_Line(64, 86, 64, 72, hour_Hand_Color);
			break;
		
		case 15:
			ST7735_Line(64, 77, 77, 77, hour_Hand_Color);
			break;
		
		case 30:
			ST7735_Line(64, 77, 64, 90, hour_Hand_Color);
			break;
		
		case 45:
			ST7735_Line(64, 77, 51, 77, hour_Hand_Color);
			break;
	
	}
	
}

void paintDigitalClock(uint32_t hour, uint32_t min){
	min = min% 60;
	hour = hour % 12;
	if(hour==0){
		hour = 12;
	}
	ST7735_FillRect(0, 20, 127, 159, ST7735_BLACK);
	char zero = '0';
	char minuteChar1= ((char)(min%10))+zero;
	char minuteChar2= ((char)(min/10))+zero;
	char hourChar1= ((char)(hour%10))+zero;
	char hourChar2= ((char)(hour/10)+zero);
	char colin = ':';
	
	ST7735_DrawCharS(20, 70, hourChar2, ST7735_BLUE, ST7735_BLACK, 3);
	ST7735_DrawCharS(40, 70, hourChar1, ST7735_BLUE, ST7735_BLACK, 3);
	ST7735_DrawCharS(60, 70, colin, ST7735_BLUE, ST7735_BLACK, 3);
	ST7735_DrawCharS(80, 70, minuteChar2, ST7735_BLUE, ST7735_BLACK, 3);
	ST7735_DrawCharS(100, 70, minuteChar1, ST7735_BLUE, ST7735_BLACK, 3);
}

